import React, { useState,useEffect } from 'react';
import ReactDOM from 'react-dom';
import axios from 'axios';

function Signup(props){

    const [data, setdata] = useState({ name: '', email: '', password: ''})  
  const apiUrl = "http://localhost:1680/api/employee/InsertEmployee";  
  const Registration = (e) => {  
    e.preventDefault();  
    debugger;  
    const data1 = { Email: data.Email, Password: data.Password, EmployeeName: data.EmployeeName, City: data.City, Department: data.Department };  
    axios.post(apiUrl, data1)  
      .then((result) => {  
        debugger;  
        console.log(result.data);  
        if (result.data.Status == 'Invalid')  
          alert('Invalid User');  
        else  
          props.history.push('/Dashboard')  
      })  
  }  
  const onChange = (e) => {  
    e.persist();  
    debugger;  
    setdata({ ...data, [e.target.name]: e.target.value });  
  }  

    return(
        <div>
        <div class="container" style={{ marginTop:"50px"}}>
        <h2> Registeration Form</h2>
        <form onSubmit={Registration}>
        <div class="form-group">
            <label for="name"> Full Name:</label>
            <input type="name" class="form-control" id="name" placeholder="Enter Full Name" name="fname" onChange={onChange} value={data.fname}  />
            <div style={{ fontSize: 12, color: "red" }}>  </div>
          </div>
          <div class="form-group">
            <label for="email">Email:</label>
            <input type="text" class="form-control" id="email" placeholder="Enter Email" name="email" onChange={onChange} value={data.email}  />
            <div style={{ fontSize: 12, color: "red" }}>  </div>
          </div>
          <div class="form-group">
            <label for="pwd">Password:</label>
            <input type="password" class="form-control" id="password" placeholder="Enter Password" name="password" onChange={onChange} value={data.password}  />
            <div style={{ fontSize: 12, color: "red" }}>  </div>
          </div>
          <button type="submit" class="btn btn-success">Submit</button>
        </form>
    </div>


      </div>

    )
}

export default Signup;
